by using slash , resourceassemblersupport is failing to properly take into account the full path of a spring mvc route. protected d createresourcewithid object id, t entity, object... parameters { assert.notnull entity, entity must not be null! ; assert.notnull id, id must not be null! ; d instance = instantiateresource entity ; instance.add linkto controllerclass, parameters .slash id .withselfrel ; return instance;
} this fails for a controller like this: @getmapping /employees/{id} public responseentity<?> findone @pathvariable string id { return responseentity.ok assembler.toresource repository.findone long.valueof id ;
} in this situation, the route mapping is /employees/1 , but yields this: { id : 1, lastname : baggins , firstname : frodo , role : ring bearer , _links : { self : { href : http://localhost:8080/1 } } }
